import { connect } from "react-redux";
import Notice from "../components/Notice";
function mapStateToProps(state) {
  return {
    data: state.data,
    booklist: state.bookListBySubject[0],
    notice: state.noticeList,
  };
}

export default connect(mapStateToProps)(Notice);
